schemas.content:
type Query {
  users(first: Int): [UserType!]!
}

type User {
  id: ID!
  name: String!
}

union UserType = Student | Professor

type Student {
  age: Int!
}

type Professor {
  degree: String
}

type User {
  id: ID!
  name: String!
  enumAnnotation: EnumAnnotation!
  enumAsUnionType: EnumAsUnionType!
}

enum EnumAnnotation {
  EDITOR
  COLLABORATOR
}

enum EnumAsUnionType {
  RED
  GREEN
  BLUE
}

type Query {
  createUser(name: String!, type: EnumAnnotation!): User
}

type Query {
  media(first: Int): [Media]
  mediaItem(id: Int!): Media
}

interface Unused {
  foo: Int
}

interface Media {
  id: ID!
  url: String!
}

type Dimensions {
  width: Int!
  height: Int!
}

type Image implements Media {
  id: ID!
  url: String!
  dimensions: Dimensions!
}

type Video implements Media {
  id: ID!
  url: String!
  duration: Int!
}

type Query {
  feed: [Post!]!
  drafts: [Post!]!
  post(id: ID!): Post
}

type Mutation {
  createUser(name: String!): User!
  createDraft(title: String!, content: String!, authorId: ID!): Post!
  deletePost(id: ID!): Post
  publish(id: ID!): Post
}

type Post {
  id: ID!
  title: String!
  content: String!
  published: Boolean!
  author: User!
}

type User {
  id: ID!
  name: String
  posts: [Post!]!
}

